import React from "react";

class EventCard extends React.Component {
  componentDidMount() {}

  render() {
    return (
      <div className="event-card">
        <h1>Sample</h1>
        <h4>{this.props.headLine}</h4>
        <p>{this.props.text}</p>
      </div>
    );
  }
}

export default EventCard;
